import React from "react";
import "./NavBarCard.css";

const NavBarCard = () => {
  const items = [
    { title: "home" },
    { title: "search" },
  ];

  const classes = "navbar";

  return (
    <div className={classes}>
      {items.map((item, index) => (
        <div key={index}>{item.title}</div>
      ))}
    </div>
  );
};
export default NavBarCard;
